现在请仅输出严格 JSON，必须完全匹配以下结构（键名、层级、字段齐全），所有数值用数字表示（保留2-3位小数），布尔用 true/false，字符串填写说明文字。不要输出任何解释文字或前后缀，也不要多余字段；若无法计算某值请给出可解析的近似值。

{
  "1) 基准工况加权平均与校验": {
    "weighted_average_LHV": "[字符串]",
    "percentage_sum": "[字符串]",
    "percentage_deviation": "[字符串]",
    "sum_validation_passed": "[布尔值]"
  },
  "2) 雨季工况加权平均与校验": {
    "weighted_average_LHV": "[字符串]",
    "percentage_sum": "[字符串]",
    "percentage_deviation": "[字符串]",
    "sum_validation_passed": "[布尔值]"
  },
  "3) 差值与百分变化及主因": {
    "difference_rainy_minus_base": "[字符串]",
    "percent_change_rainy_vs_base": "[字符串]",
    "top_contributors": "[3个字符串的数组]",
    "explanation": "[字符串]"
  },
  "4) 逐组分贡献求和与交叉验证": {
    "sum_of_component_contributions_S1": "[字符串]",
    "tolerance_epsilon": "[字符串]",
    "validation_against_R1": "[字符串]",
    "passed": "[布尔值]"
  },
  "5) 可视化一致性说明": "[字符串]",
  "6) JSON报告路径与字段修正点": {
    "report_file_path": "[字符串]",
    "schema_fix_note": "[字符串]"
  }
}

