    "percent_change_rainy_vs_base": "-12.0%",
    "top_contributors": [
      "塑料",
      "厨余/餐厨垃圾",
      "纸类"
    ],
    "explanation": "热值下降主因是雨季导致所有可燃组分热值等比例降低，其中对总热值贡献最高的组分（如塑料、厨余/餐厨垃圾）的热值损失是整体热值下降的主要来源。"
  },
  "4) 逐组分贡献求和与交叉验证": {
    "sum_of_component_contributions_S1": "7575.00 kJ/kg",
    "tolerance_epsilon": "0.001 kJ/kg",
    "validation_against_R1": "绝对差值 |S1 - R1| = 0.00 kJ/kg，小于等于容差 ε",
    "passed": true
  },
  "5) 可视化一致性说明": "根据计算，基准工况热值贡献最高的组分是塑料（3000 kJ/kg），最低的可燃组分是园林绿化/枝叶（180 kJ/kg）。因此，贡献柱状图的最高柱应为塑料，最低可燃物柱应为园林绿化/枝叶，与文本分析结果一致。",
  "6) JSON报告路径与字段修正点": {
    "report_file_path": "waste_calorific_calculation_case_74.json",
    "schema_fix_note": "为满足规范，建议将各组分的热值字段（如“基准 3500”）修正为结构化的键值对，例如 'lhv_baseline_kj_per_kg': 3500，以提升数据可读性与机器解析性。"
  }
}
```

